<script>
import gsap from 'gsap'

export default {
  name: 'Compass',
  props: {
    width: {
      type: [Number, String],
      default: 18
    },
    height: {
      type: [Number, String],
      default: 18
    },
    value: {
      type: Number,
      default: 0,
    },
  },
  data: () => ({
    rotateAnim: null,
  }),
  watch: {
    value(newVal, oldVal) {
      console.log(`${newVal}, ${oldVal}`)

      if (newVal === oldVal) {
        return
      }

      if (this.rotateAnim !== null) {
        this.rotateAnim.kill()
      }

      let r = `-${newVal}_short`
      let self = this

      this.rotateAnim = gsap.to(this.$refs.plate, {
          duration: 0.5,
          rotation: r,
          repeat: 0,
          transformOrigin: '50% 50%',
          ease: 'none',
          onComplete: () => {
            self.rotateAnim.kill()
            self.rotateAnim = null
          }
        }
      )
      this.rotateAnim.play()

    }
  }
} 
</script>